import React, { useEffect, useRef } from 'react';

const SoftSkills = () => {
  const progressRefs = useRef([]);

  const softSkills = [
    {
      icon: "bi-lightning-charge",
      title: "Proatividade",
      description: "Antecipo necessidades e busco soluções antes que se tornem problemas, sempre pensando à frente para otimizar processos.",
      features: [
        "Iniciativa em novos projetos",
        "Solução antecipada de problemas",
        "Melhoria contínua de processos"
      ],
      percentage: 95
    },
    {
      icon: "bi-book",
      title: "Aprendizado Contínuo",
      description: "Busco constantemente atualização em tecnologias e metodologias, mantendo-me à frente das tendências do mercado.",
      features: [
        "Curiosidade intelectual",
        "Adaptação a novas tecnologias",
        "Compartilhamento de conhecimento"
      ],
      percentage: 92
    },
    {
      icon: "bi-arrow-repeat",
      title: "Adaptabilidade",
      description: "Ajusto-me rapidamente a mudanças, ambientes dinâmicos e novas exigências, mantendo a qualidade do trabalho.",
      features: [
        "Flexibilidade em diferentes cenários",
        "Resiliência frente a mudanças",
        "Capacidade de pivotar quando necessário"
      ],
      percentage: 85
    }
  ];

  useEffect(() => {
    // Animar as barras de progresso quando o componente for montado
    progressRefs.current.forEach((ref, index) => {
      if (ref) {
        setTimeout(() => {
          ref.style.transform = 'translateX(0)';
        }, 300 + (index * 200));
      }
    });
  }, []);

  return (
    <section id="services-alt" className="services-alt section">
      <div className="container" data-aos="fade-up" data-aos-delay="100">
        <div className="row">
          <div className="col-lg-12" data-aos="fade-up" data-aos-delay="100">
            <div className="content-block">
              <div className="container section-title" data-aos="fade-up">
                <h2 data-translate="softskills_title">Soft Skills</h2>
              </div>

              <div className="softskills-container">
                <div className="softskills-grid">
                  {softSkills.map((skill, index) => (
                    <div key={index} className="softskill-card">
                      <div className="skill-header">
                        <div className="skill-icon">
                          <i className={`bi ${skill.icon}`}></i>
                        </div>
                        <h3 className="skill-title" data-translate={`softskill_${skill.title.toLowerCase().replace(/\s+/g, '_')}_title`}>
                          {skill.title}
                        </h3>
                      </div>

                      <div className="skill-content">
                        <p className="skill-description" data-translate={`softskill_${skill.title.toLowerCase().replace(/\s+/g, '_')}_desc`}>
                          {skill.description}
                        </p>

                        <ul className="skill-features">
                          {skill.features.map((feature, featureIndex) => (
                            <li key={featureIndex} data-translate={`softskill_${skill.title.toLowerCase().replace(/\s+/g, '_')}_item${featureIndex + 1}`}>
                              {feature}
                            </li>
                          ))}
                        </ul>

                        <div className="skill-progress">
                          <div className="progress-label">
                            <span data-translate="softskill_level">Nível de experiência</span>
                            <span>{skill.percentage}%</span>
                          </div>
                          <div className="progress-bar">
                            <div 
                              className="progress-fill" 
                              ref={el => progressRefs.current[index] = el}
                              style={{ 
                                width: `${skill.percentage}%`,
                                transform: 'translateX(-100%)'
                              }}
                            ></div>
                          </div>
                        </div>
                      </div>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default SoftSkills;
